import React from 'react'
import ExpenceInOrder from './ExpenceInOrder'

const ExpenceList = ({transactions}) => {

    return (
        <div>
            <h2>Transactions</h2>
            <ul>
                <li>
                    {transactions.map(transaction => 
                        <ExpenceInOrder transaction={transaction} key={transaction.id}/>
                        )}
                </li>
            </ul>
        </div>
    )
}

export default ExpenceList
